import React from 'react';
import './footer.scss'
import { Link } from 'react-router-dom';


const Footer = () => {
      return (

            <footer className='footer'>
                  <div className='container'>
                        <ul className='footer_nav'>
                              <Link className='footer_nav-list'>WatsApp</Link>
                              <Link className='footer_nav-list'>Instagram</Link>
                              <Link className='footer_nav-list'>Telegram</Link>
                              <Link className='footer_nav-list'>About</Link>
                        </ul>
                  </div>

            </footer>


      );
}

export default Footer;
